import React from 'react'
import { useNavigate } from 'react-router-dom';
function Navbar() {
  const Navigate = useNavigate();
  function createPost() {
    Navigate('/newPost');
  }
  return (
    <div>
      <nav className='nav'>
      <div>
        <button className="btn btn-create" onClick={createPost}>
          Create Post
        </button>
      </div>
      </nav>
    </div>
  )
}

export default Navbar
